import React from 'react'

//console.log('moHeaderSideDoValente ');

const moHeaderSideDoValente = function (props) {
  var cidade = props.cidade;
  var modo = props.modo;

  return (
    <div className='DivHeaderSideDoValente'>
      <p>Site do Valente<br/>
      Cidade : {cidade}<br/>
      Modo : {modo}</p>
      <style jsx>{`
      .DivHeaderSideDoValente {
        background-color: #696969;
        width: 100%;
        color: #333;
        font-size: 17px;

        font-family: sans-serif;
        background-color: #ffffff;
        border-radius: 8px;
        color: #222222;
        display: block;
        height: 3.42857143rem;
        text-align: center;
            width: 300px;
            text-decoration: none;
            border: solid 1px #dbdbdb;
            cursor: pointer;
            outline: 0;
            margin: 0;
            padding: 1.2rem;
            box-sizing: border-box;
            font-style: normal;
            transition: 0.5s;
            -webkit-box-shadow: 2px 2px 20px rgba(1, 1, 1, 0.17);
            -moz-box-shadow: 2px 2px 20px rgba(1, 1, 1, 0.17);
            box-shadow: 2px 2px 20px rgba(1, 1, 1, 0.17);        
      }
    `}</style>
    </div>
  )
}

export default moHeaderSideDoValente
